import React from 'react';
import './Home.css';
import { useNavigate } from 'react-router-dom';
import Typist from 'react-typist';

function TypingAnimation() {
  return (
    <div>
      <Typist>
        <h1>Hello, world!</h1>
        <Typist.Delay ms={500} />
        <Typist.Strong>Welcome to React!</Typist.Strong>
        <Typist.Backspace count={10} delay={1000} />
        <Typist.Delay ms={500} />
        <span>Enjoy your stay.</span>
      </Typist>
    </div>
  );
}


function Home() {
  const navigate = useNavigate();

  const handleClick = (path) => {
    navigate('/'+path);
  };
  return (
    <div>
      <div className="header">
        <div className="rishi-container">
          <div className="rishi"> rishi. </div>
        </div>
          <div className="route-container">
          <div className="route-item">
            <span className="route-text" onClick={() => handleClick('')}> Home </span>
          </div>
          <div className="route-item">
            <span className="route-text" onClick={() => handleClick('Timeline')}> Timeline </span>
          </div>
          <div className="route-item">
            <span className="route-text" onClick={() => handleClick('Projects')}> Projects </span>
          </div>
          <div className="route-item">
            <span className="route-text" onClick={() => handleClick('Blogs')}> Blogs </span>
          </div>
        </div>
      </div>
      <div className="name-item">
        Korpala Hrushikesh
      </div>
      <p class="line-1 anim-typewriter">I am Software Engineer</p>
    </div>
  );
}

export default Home;
